import axios from 'axios';

const path = `${process.env.HOST}:${process.env.PORT}/${process.env.API_VERSION}/auth`;

export const signIn = (username, password) => (
    axios
        .post(`${path}/signin`, {
            username,
            password
        })
        .then(results => results)
        .catch(err => console.log(err))
);
